/*Table structure for table `leave_status` */

DROP TABLE IF EXISTS `leave_status`;

CREATE TABLE `leave_status` (
  `name` varchar(20) NOT NULL,
  `message` varchar(20) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `leave_status` */

insert into `leave_status` (`name`,`message`) values ('Abhinav','APPROVED'),('Abhinav','APPROVED'),('Abhinav','APPROVED'),('Abhinav','DISAPPROVED'),('Abhinav','DISAPPROVED'),('Abhinav','APPROVED'),('Abhinav','APPROVED');

/*Table structure for table `myimage` */

DROP TABLE IF EXISTS `myimage`;

CREATE TABLE `myimage` (
  `ID` int(5) NOT NULL auto_increment,
  `Name` varchar(20) default NULL,
  `Description` varchar(50) default NULL,
  `Image` longblob,
  PRIMARY KEY  (`ID`)
